PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE journal (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	bank VARCHAR(255) NOT NULL,
	account_number VARCHAR(10) NOT NULL,
	routing_number VARCHAR(8) NOT NULL,
	iban VARCHAR(34) NOT NULL,
	bic VARCHAR(11) NOT NULL,
	hbci_url VARCHAR(255) NOT NULL,
	finance_account_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(finance_account_id) REFERENCES finance_account (id)
);
CREATE TABLE journal_entry (
	id INTEGER NOT NULL,
	journal_id INTEGER NOT NULL,
	amount INTEGER NOT NULL,
	description TEXT NOT NULL,
	original_description TEXT NOT NULL,
	other_account_number VARCHAR(255) NOT NULL,
	other_routing_number VARCHAR(255) NOT NULL,
	other_name VARCHAR(255) NOT NULL,
	import_time DATETIME NOT NULL,
	transaction_date DATE NOT NULL,
	valid_date DATE NOT NULL,
	transaction_id INTEGER,
	PRIMARY KEY (id),
	FOREIGN KEY(journal_id) REFERENCES journal (id),
	FOREIGN KEY(transaction_id) REFERENCES "transaction" (id)
);
CREATE TABLE "transaction" (
	id INTEGER NOT NULL,
	description TEXT NOT NULL,
	transaction_date DATETIME NOT NULL,
	valid_date DATE NOT NULL,
	PRIMARY KEY (id)
);
CREATE TABLE finance_account (
	id INTEGER NOT NULL,
	name VARCHAR(127) NOT NULL,
	type VARCHAR(9) NOT NULL,
	PRIMARY KEY (id),
	CONSTRAINT finance_account_type CHECK (type IN ('ASSET', 'LIABILITY', 'EXPENSE', 'REVENUE'))
);
CREATE TABLE split (
	id INTEGER NOT NULL,
	amount INTEGER NOT NULL,
	account_id INTEGER NOT NULL,
	transaction_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(account_id) REFERENCES finance_account (id),
	FOREIGN KEY(transaction_id) REFERENCES "transaction" (id)
);
CREATE TABLE traffic_volume (
    id INTEGER NOT NULL,
    size BIGINT NOT NULL,
    timestamp DATETIME NOT NULL,
    type VARCHAR(3) NOT NULL,
    ip_id INTEGER NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT traffic_types CHECK (type IN ('IN', 'OUT')),
    FOREIGN KEY(ip_id) REFERENCES ip (id)
);
CREATE TABLE semester (
    id INTEGER NOT NULL,
    name VARCHAR NOT NULL,
    registration_fee INTEGER NOT NULL,
    regular_membership_fee INTEGER NOT NULL,
    reduced_membership_fee INTEGER NOT NULL,
    overdue_fine INTEGER NOT NULL,
    premature_begin_date DATE NOT NULL,
    begin_date DATE NOT NULL,
    end_date DATE NOT NULL,
    belated_end_date DATE NOT NULL,
    PRIMARY KEY (id),
    CHECK (registration_fee > 0),
    CHECK (regular_membership_fee > 0),
    CHECK (reduced_membership_fee > 0),
    CHECK (overdue_fine > 0),
    CHECK (premature_begin_date < begin_date),
    CHECK (begin_date < end_date),
    CHECK (end_date < belated_end_date)
);
CREATE TABLE "group" (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	type VARCHAR(17) NOT NULL,
	PRIMARY KEY (id)
);
CREATE TABLE dormitory (
	id INTEGER NOT NULL,
	number VARCHAR(3) NOT NULL,
	short_name VARCHAR(5) NOT NULL,
	street VARCHAR(20) NOT NULL,
	PRIMARY KEY (id),
	UNIQUE (number),
	UNIQUE (short_name)
);
CREATE TABLE vlan (
	id INTEGER NOT NULL,
	name VARCHAR(127) NOT NULL,
	tag INTEGER NOT NULL,
	PRIMARY KEY (id)
);
CREATE TABLE subnet (
	id INTEGER NOT NULL,
	address VARCHAR(51) NOT NULL,
	gateway VARCHAR(51) NOT NULL,
	dns_domain VARCHAR,
	reserved_addresses INTEGER NOT NULL,
	ip_type VARCHAR(1) NOT NULL,
	PRIMARY KEY (id),
	CONSTRAINT subnet_ip_type CHECK (ip_type IN ('4', '6'))
);
CREATE TABLE port (
	id INTEGER NOT NULL,
	type VARCHAR(15) NOT NULL,
	name VARCHAR(4) NOT NULL,
	PRIMARY KEY (id)
);
CREATE TABLE destination_port (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES port (id)
);
CREATE TABLE association_dormitory_vlan (
	dormitory_id INTEGER,
	vlan_id INTEGER,
	FOREIGN KEY(dormitory_id) REFERENCES dormitory (id),
	FOREIGN KEY(vlan_id) REFERENCES vlan (id)
);
CREATE TABLE association_subnet_vlan (
	subnet_id INTEGER,
	vlan_id INTEGER,
	FOREIGN KEY(subnet_id) REFERENCES subnet (id),
	FOREIGN KEY(vlan_id) REFERENCES vlan (id)
);
CREATE TABLE traffic_group (
	id INTEGER NOT NULL,
	traffic_limit BIGINT NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES "group" (id)
);
CREATE TABLE room (
	id INTEGER NOT NULL,
	number VARCHAR(36) NOT NULL,
	level INTEGER NOT NULL,
	inhabitable BOOLEAN NOT NULL,
	dormitory_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	CHECK (inhabitable IN (0, 1)),
	FOREIGN KEY(dormitory_id) REFERENCES dormitory (id)
);
CREATE TABLE property_group (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES "group" (id)
);
CREATE TABLE "user" (
	id INTEGER NOT NULL,
	login VARCHAR(40) NOT NULL UNIQUE,
	name VARCHAR(255) NOT NULL,
	registration_date DATETIME NOT NULL,
	passwd_hash VARCHAR,
	email VARCHAR(255),
	finance_account_id INTEGER,
	room_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(room_id) REFERENCES room (id),
	FOREIGN KEY(finance_account_id) REFERENCES finance_account (id)
);
CREATE TABLE patch_port (
	id INTEGER NOT NULL,
	destination_port_id INTEGER,
	room_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES port (id),
	FOREIGN KEY(destination_port_id) REFERENCES destination_port (id),
	FOREIGN KEY(room_id) REFERENCES room (id)
);
CREATE TABLE phone_port (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES destination_port (id)
);
CREATE TABLE property (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	granted BOOLEAN NOT NULL,
	property_group_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	CHECK (granted IN (0, 1)),
	FOREIGN KEY(property_group_id) REFERENCES property_group (id)
);
CREATE TABLE log_entry (
	id INTEGER NOT NULL,
	type TEXT,
	message TEXT NOT NULL,
	timestamp DATETIME NOT NULL,
	author_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(author_id) REFERENCES user (id)
);
CREATE TABLE host (
	id INTEGER NOT NULL,
	type VARCHAR(50),
	user_id INTEGER,
	room_id INTEGER,
	PRIMARY KEY (id),
	FOREIGN KEY(user_id) REFERENCES user (id) ON DELETE CASCADE,
	FOREIGN KEY(room_id) REFERENCES room (id)
);
CREATE TABLE membership (
	id INTEGER NOT NULL,
	start_date DATETIME NOT NULL,
	end_date DATETIME,
	group_id INTEGER NOT NULL,
	user_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(group_id) REFERENCES "group" (id) ON DELETE CASCADE,
	FOREIGN KEY(user_id) REFERENCES user (id) ON DELETE CASCADE
);
CREATE TABLE server_host (
	id INTEGER NOT NULL,
	name VARCHAR(255),
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE record (
	id INTEGER NOT NULL,
	type VARCHAR(50),
	host_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(host_id) REFERENCES host (id) ON DELETE CASCADE
);
CREATE TABLE switch (
	id INTEGER NOT NULL,
	name VARCHAR(127) NOT NULL,
	management_ip VARCHAR(127) NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE net_device (
	id INTEGER NOT NULL,
	type VARCHAR(50),
	mac VARCHAR(17) NOT NULL,
	host_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(host_id) REFERENCES host (id) ON DELETE CASCADE
);
CREATE TABLE user_host (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE user_log_entry (
	id INTEGER NOT NULL,
	user_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES log_entry (id),
	FOREIGN KEY(user_id) REFERENCES user (id)
);
CREATE TABLE ip (
	id INTEGER NOT NULL,
	address VARCHAR(51) NOT NULL,
	net_device_id INTEGER NOT NULL,
	subnet_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	UNIQUE (address),
	FOREIGN KEY(net_device_id) REFERENCES net_device (id) ON DELETE CASCADE,
	FOREIGN KEY(subnet_id) REFERENCES subnet (id)
);
CREATE TABLE switch_net_device (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES net_device (id)
);
CREATE TABLE user_net_device (
	id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES net_device (id)
);
CREATE TABLE srv_record (
	id INTEGER NOT NULL,
	service VARCHAR(255) NOT NULL,
	time_to_live INTEGER,
	priority INTEGER NOT NULL,
	weight INTEGER NOT NULL,
	port INTEGER NOT NULL,
	target VARCHAR(255) NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id)
);
CREATE TABLE ns_record (
	id INTEGER NOT NULL,
	domain VARCHAR(255) NOT NULL,
	server VARCHAR(255) NOT NULL,
	time_to_live INTEGER,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id)
);
CREATE TABLE cname_record (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	record_for_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id),
	FOREIGN KEY(record_for_id) REFERENCES record (id) ON DELETE CASCADE
);
CREATE TABLE mx_record (
	id INTEGER NOT NULL,
	server VARCHAR(255) NOT NULL,
	domain VARCHAR(255) NOT NULL,
	priority INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id)
);
CREATE TABLE switch_port (
	id INTEGER NOT NULL,
	switch_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES destination_port (id),
	FOREIGN KEY(switch_id) REFERENCES switch (id)
);
CREATE TABLE aaaa_record (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	time_to_live INTEGER,
	address_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id),
	FOREIGN KEY(address_id) REFERENCES ip (id)
);
CREATE TABLE server_net_device (
	id INTEGER NOT NULL,
	switch_port_id INTEGER,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES net_device (id),
	FOREIGN KEY(switch_port_id) REFERENCES switch_port (id)
);
CREATE TABLE a_record (
	id INTEGER NOT NULL,
	name VARCHAR(255) NOT NULL,
	time_to_live INTEGER,
	address_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES record (id),
	FOREIGN KEY(address_id) REFERENCES ip (id)
);

CREATE TABLE room_log_entry (
	id INTEGER NOT NULL,
	room_id INTEGER NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY(id) REFERENCES log_entry (id),
	FOREIGN KEY(room_id) REFERENCES room (id)
);
COMMIT;
